// frontend/src/components/ConfigurationForm.js
import React, { useState } from 'react';

function ConfigurationForm() {
  const [config, setConfig] = useState({
    totalTickets: 100,
    ticketReleaseRate: 2000,
    customerRetrievalRate: 3000,
    maxTicketCapacity: 100
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setConfig({ ...config, [name]: value });
  };

  const submitConfig = () => {
    // API call to submit config to backend
  };

  return (
    <div>
      <h2>Configuration</h2>
      <input name="totalTickets" onChange={handleInputChange} value={config.totalTickets} />
      <button onClick={submitConfig}>Submit Configuration</button>
    </div>
  );
}

export default ConfigurationForm;
